import Link from 'next/link';


const Navbar = () => (

    <div>
        <ul>
             <li><Link to = "/"><a> Home </a></Link></li>
            <li><Link to = "/about"><a> about</a></Link></li>
            
        </ul>

    </div>

);

export default Navbar;
